class Book{constructor(i,e,a,o,n){this.name=i,this.author=e,this.description=a,this.imageUrl=o,this.link=n}}const books=[new Book("Dziewczyna, kt\xF3ra prze\u015Bcign\u0119\u0142a czas","Anna Benning","Trylogia \u201EVortex\u201D Anny Benning to niesamowita podr\xF3\u017C przez ca\u0142kowicie nowe uniwersum.","https://s.lubimyczytac.pl/upload/books/4997000/4997961/952056-352x500.jpg","/book1"),new Book("Wied\u017Amin. Rozdro\u017Ce kruk\xF3w","Sapkowski Andrzej","Trylogia \u201EVortex\u201D Anny Benning to niesamowita podr\xF3\u017C przez ca\u0142kowicie nowe uniwersum.","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/wiedzmin-rozdroze-krukow-b-iext172758687.jpg","/book1"),new Book("Miecz przeznaczenia. Wied\u017Amin. Tom 2","Sapkowski Andrzej","Autor serii o Wied\u017Aminie, Andrzej Sapkowski, jest mistrzem fantasy o \u015Bwiatowej klasie. Wied\u017Ami\u0144ska saga sk\u0142ada si\u0119 z wielu opowiada\u0144, a w\u015Br\xF3d nich z pewno\u015Bci\u0105 zainteresuj\u0105 Ci\u0119 te, kt\xF3re znalaz\u0142y si\u0119 w 2. tomie serii. O czym opowiada ksi\u0105\u017Cka \u201EMiecz przeznaczenia\u201D?","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/miecz-przeznaczenia-wiedzmin-tom-2-b-iext161093107.jpg","/book1"),new Book("Ostatnie \u017Cyczenie. Wied\u017Amin. Tom 1","Sapkowski Andrzej","Si\u0119gaj\u0105c po sag\u0119 wied\u017Ami\u0144sk\u0105, masz szans\u0119 wkroczy\u0107 w fantastyczny \u015Bwiat wykreowany przez Andrzeja Sapkowskiego. W pierwszym tomie sagi pod tytu\u0142em \u201EOstatnie \u017Cyczenie\u201D poznasz pocz\u0105tek historii Geralta z Rivii i wraz z nim wyruszysz w \u015Bwiat przyg\xF3d.","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/ostatnie-zyczenie-wiedzmin-tom-1-b-iext161038682.jpg","/book1"),new Book("Pani Jeziora. Wied\u017Amin. Tom 7","Sapkowski Andrzej","Ciri wpatruje si\u0119 w wypuk\u0142y relief przedstawiaj\u0105cy ogromnego \u0142uskowatego w\u0119\u017Ca. Gad, zwin\u0105wszy si\u0119 w kszta\u0142t \xF3semki, wgryz\u0142 si\u0119 z\u0119biskami we w\u0142asny ogon. To pradawny w\u0105\u017C Uroboros.","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/pani-jeziora-wiedzmin-tom-7-b-iext161092730.jpg","/book1"),new Book("Wie\u017Ca jask\xF3\u0142ki. Wied\u017Amin. Tom 6","Sapkowski Andrzej","Jesienne Ekwinokcjum tego\u017C dziwnego roku przynios\u0142o rozmaite znaki na niebie i na ziemi, kt\xF3re jakowe\u015B kl\u0119ski niechybnie zwiastowa\u0142y.","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/wieza-jaskolki-wiedzmin-tom-6-b-iext161087851.jpg","/book1"),new Book("Chrzest ognia. Wied\u017Amin. Tom 5","Sapkowski Andrzej","to Geraltowa kompania:Jaskier, trubadur, Milva, Regis i td","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/chrzest-ognia-wiedzmin-tom-5-b-iext146808430.jpg","/book1"),new Book("Krew elf\xF3w. Wied\u017Amin. Tom 3","Sapkowski Andrzej","Mistrz gatunku fantasy w Polsce \u2013 Andrzej Sapkowski \u2013 napisa\u0142 sag\u0119 na miar\u0119 najlepszych powie\u015Bci o fantastycznych \u015Bwiatach. G\u0142\xF3wnym bohaterem uczyni\u0142 on Geralta \u2013 wied\u017Amina, z kt\xF3rym czytelnik mo\u017Ce prze\u017Cywa\u0107 fascynuj\u0105ce, ale i niebezpieczne przygody.","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/krew-elfow-wiedzmin-tom-3-b-iext146807006.jpg","/book1"),new Book("Gra o tron. Pie\u015B\u0144 Lodu i Ognia. Tom 1","Martin George R. R.","W kolejnej ksi\u0105\u017Cce fantasy Martina Georgea R. R. przenosimy si\u0119 w Zachodnie Krainy. Po o\u015Bmiu tysi\u0105cach lat zapisanej historii widmo wojen i katastrofy nieustannie wisi nad osadami ludzkimi. Zbli\u017Ca si\u0119 kolejna zima, lodowate wichry i mrozy wiej\u0105 z p\xF3\u0142nocy, gdzie schroni\u0142y si\u0119 wyparte przez ludzi pradawne rasy i starzy bogowie. Na szcz\u0119\u015Bcie dla Zachodniej Krainy wszyscy zbuntowani w\u0142adcy pokonali szalonego Smoczego Kr\xF3la, Aerysa Targaryena, zasiadaj\u0105cego na \u017Belaznym Tronie Zachodnich Krain. Niestety pokonany kr\xF3l pozostawi\u0142 po sobie potomstwo, r\xF3wnie szalone i niebezpieczne jak on sam...","https://ecsmedia.pl/cdn-cgi/image/format=webp,width=544,height=544,/c/gra-o-tron-piesn-lodu-i-ognia-tom-1-b-iext171289236.jpg","/book1")];module.exports={Book,books};
